import { GeoLocation } from "./Geolocation";

export async function getConnection() {
    try {
        const coords = GeoLocation.response;
        const response = await fetch(`https://cors-anywhere.herokuapp.com/https://www.metaweather.com/api/location/`);
        const data = await response.json();
        console.log(response);
        //console.log(data);
    } catch (error) {
        console.log('ERROR');
    }
}
